import React from "react";
import { Box } from "@chakra-ui/core";
import moment from "moment";

export default function Item({ id, name, price, date, category, queryCache }) {
  const removeItem = async () => {
    const response = await fetch(`http://tabsystem.test/api/item/${id}`, {
      method: "DELETE",
      mode: "cors", // no-cors, *cors, same-origin
      cache: "no-cache", // *default, no-cache, reload, force-cache, only-if-cached
      credentials: "omit", // include, *same-origin, omit
      headers: {
        Authorization: `Bearer ${localStorage.getItem("token")}`,
        "content-type": "application/json",
      },
      redirect: "follow", // manual, *follow, error
      referrerPolicy: "no-referrer", // no-referrer, *client
    });
    const data = await response.json();
    queryCache.refetchQueries("GetTabById");
    queryCache.refetchQueries("GetUserOfTab");
    console.log(data);
  };
  const removeItemWithRefund = async () => {
    const response = await fetch(`http://tabsystem.test/api/itemrefund/${id}`, {
      method: "DELETE",
      mode: "cors", // no-cors, *cors, same-origin
      cache: "no-cache", // *default, no-cache, reload, force-cache, only-if-cached
      credentials: "omit", // include, *same-origin, omit
      headers: {
        Authorization: `Bearer ${localStorage.getItem("token")}`,
        "content-type": "application/json",
      },
      redirect: "follow", // manual, *follow, error
      referrerPolicy: "no-referrer", // no-referrer, *client
    });
    const data = await response.json();
    queryCache.refetchQueries("GetTabById");
    queryCache.refetchQueries("GetUserOfTab");
    console.log(data);
  };
  const formatedDate = () => {
    return moment(date).format("MM/DD");
  };
  return (
    <Box display="flex" justifyContent="space-around">
      <p>date: {formatedDate()}</p>
      <p>name: {name}</p>
      {category ? <p>category: {category.name}</p> : <p>Category: none</p>}
      <p>price: {price}</p>
      <button onClick={removeItemWithRefund}>del w/refund</button>
      <button onClick={removeItem}>del</button>
      <Box borderBottom="1px solid gray" mx="5%" />
    </Box>
  );
}
